v8:item.v8:content:
Принимает значение: 1 | 2, где:
1- документ составлен при приемке ценностей от продавца (отправителя, перевозчика);
2- документ составлен после приемки ценностей от продавца (отправителя, перевозчика) в течение согласованного сторонами периода

Принимает значение: 1ХХХ | 2ХХХ | 3ХХХ, где:
1ХХХ - приемка без документов или без расхождений с документом;
2ХХХ - приемка с расхождениями и/или с ценовыми отклонениями;
3ХХХ - расхождения с документами;
4ХХХ – расхождения в прослеживаемости и маркировке без расхождений по наименованию, количеству, качеству и без ценовых отклонений.
ХХХ могут быть использованы для автоматизации или равняться "000"

1 - Лицо, принявшее ценности; 
2 - Лицо, принявшее ценности и ответственное за оформление события (операции);
3 - Лицо, ответственное за оформление события (операции);
7 - Председатель комиссии;
8 - Член комиссии

3 - Работник иной уполномоченной организации;
4 - Уполномоченное физическое лицо (в том числе индивидуальный предприниматель);
5 - Работник организации - покупателя;
6 - Работник организации – составителя файла обмена информации покупателя
